import React, { useContext } from 'react'
import {MyContext} from '../contexts/BookContext'
function Navbar() {
    const {books} = useContext(MyContext)
    return (
        <>
               {
                   books.map((value)=>{
                       return(
                       <li>{value.author}</li>
                       )
                   })
               }   
        </>
    )
}

export default Navbar
